using Mestreflix.Models;
using Microsoft.AspNetCore.Identity.EntityFrameworkCore;
using Microsoft.EntityFrameworkCore;

namespace Mestreflix.Data
{
    public class MovieContext : IdentityDbContext
    {
        public MovieContext(DbContextOptions<MovieContext> options) : base(options) { }

        public DbSet<Movie> Movies { get; set; } = null!;
        public DbSet<Review> Reviews { get; set; } = null!;

        protected override void OnModelCreating(ModelBuilder modelBuilder)
        {
            base.OnModelCreating(modelBuilder);

            modelBuilder.Entity<Review>()
                .HasOne(p => p.Movie)
                .WithMany(b => b.Reviews)
                .HasForeignKey(p => p.MovieId);

            modelBuilder.Entity<Movie>().HasData(new Movie[]
            {
                new Movie
                {
                    Id = 1,
                    Cover = "data:image/jpeg;base64,",
                    Genre = "Ação",
                    Price = (decimal)89.9,
                    ReleaseDate = new DateTime(1986, 6, 18),
                    Title = "Top Gun - Ases Indomáveis"
                },
                new Movie
                {
                    Id = 2,
                    Cover = "data:image/jpeg;base64,",
                    Genre = "Ação",
                    Price = (decimal)198.8,
                    ReleaseDate = new DateTime(2022, 05, 26),
                    Title = "Top Gun - Maverick"
                }
            });

            modelBuilder.Entity<Review>().HasData(new Review[]
                {
                    new Review
                    {
                        Id = 1,
                        Email = "renato.mestre@hotmail.com",
                        FullName = "Renato Mestre",
                        MovieId = 1,
                        Text = "Achei bem bacana, inclusive para a época!\nLançou no mês que eu nasci..."
                    }
                });
        }
    }
}
